css:
.tree-view-resizer {
  position: relative;
  height: 100%;
  overflow: hidden;
  cursor: default;
  -webkit-user-select: none;
  min-width: 100px;
  width: 200px;
  z-index: 2;
}
.tree-view-resizer .tree-view-resize-handle {
  position: absolute;
  top: 0;
  right: -5px;
  bottom: 0;
  width: 10px;
  cursor: col-resize;
  z-index: 3;
}
.tree-view-scroller {
  height: 100%;
  width: 100%;
  overflow: auto;
}
.tree-view {
  min-width: -webkit-min-content;
  min-height: 100%;
  padding: 0 5px;
  position: relative;
}
